import { Employee } from './employee';
import { Workflow } from './workflow';

export class Request {
    id?: string;
    title?: string;
    description?: string;
    requestType?: string;
    requesterId?: number;
    assignedTo?: number;
    status?: string;
    priority?: string;
    dueDate?: Date;
    created?: Date;
    updated?: Date;
    requester?: Employee;
    assignee?: Employee;
    workflows?: Workflow[];
}
